import { VFC } from 'react';
import styled from "styled-components";

type IconLinkProps = {
    href: string,
    src: string,
    alt: string
}

export const IconLink:VFC<IconLinkProps> = ({href,src,alt})=> {
    return(
        <a href={href}><IconLink src={src} alt={alt}></IconLink></a>
    )
}

const StyledIconLink =styled.img`
    width:40px;
    height:auto;
    margin-right:7px;
    padding: 8px 16px;
    background: black;
    
&:hover{
    background: #383d43;
	transition: 0.2s ;
}
`
